    <div id="data"></div>

    <script>
      const dayElements = document.getElementsByClassName('ContributionCalendar-day');
      const daysData = [];
      let index = 0;

      for (let day of dayElements) {
        daysData.push(day.dataset.level);
        switch(day.dataset.level) {
          case '0':
            day.innerHTML = 'A';
            break;
          case '1':
            day.innerHTML = 'B';
            break;
          case '2':
            day.innerHTML = 'C';
            break;
          case '3':
            day.innerHTML = 'D';
            break;
          case '4':
            day.innerHTML = 'E';
            break;
        }
        index += 1;
      }

      const counts = { 0: 0, 1: 0, 2: 0, 3: 0, 4: 0 };

      daysGroup = Object.groupBy(daysData, (x) => x);
      for (const [key, value] of Object.entries(daysGroup)) {
        counts[key] = value.length;
      };

      document.getElementById('data').innerText = JSON.stringify(counts);
    </script>
